To create a Chrome extension that takes screenshots of a webpage and saves them to a folder on the user's computer, follow these steps:

1. Create a new folder for your extension and create the following files inside it:
   - `manifest.json`
   - `background.js`
   - `content_script.js`
   - `screenshot.html`

2. Open `manifest.json` and add the following content:

```json
{
  "manifest_version": 3,
  "name": "Webpage Screenshot Extension",
  "version": "1.0",
  "action": {
    "default_popup": "screenshot.html"
  },
  "permissions": [
    "activeTab",
    "storage",
    "downloads",
    "tabs",
    "https://*/*",
    "http://*/*"
  ],
  "background": {
    "service_worker": "background.js"
  },
  "content_scripts": [
    {
      "matches": ["<all_urls>"],
      "js": ["content_script.js"]
    }
  ],
  "icons": {
    "16": "icon16.png",
    "48": "icon48.png",
    "128": "icon128.png"
  }
}
```

Replace the `icons` section with the paths to your extension's icons if you have them.

3. Open `background.js` and add the following content:

```javascript
chrome.runtime.onMessageReceived.addListener((request, sender, sendResponse) => {
  if (request.action === 'takeScreenshot') {
    chrome.tabs.query({ active: true, currentWindow: true }, (tabs) => {
      chrome.tabs.sendMessage(tabs[0].id, { action: 'takeScreenshot' });
    });
  }
});
```

4. Open `content_script.js` and add the following content:

```javascript
chrome.runtime.onMessageReceived.addListener((request, sender, sendResponse) => {
  if (request.action === 'takeScreenshot') {
