func handleRequest(w dns.ResponseWriter, r *dns.Msg) {
	m := new(dns.Msg)
	m.SetReply(r)

	for _, q := range r.Question {
		ips := resolve(q)
		for _, ip := range ips {
			answer := new(dns.A)
			answer.Hdr = m.Answer[0].Hdr
			answer.A = net.ParseIP(ip)
			m.Answer = append(m.Answer, answer)
		}
	}

	w.WriteMsg(m)
}

func resolve(q *dns.Question) []string {
	ipsMutex.Lock()
	defer ipsMutex.Unlock()

