function mergeArrays(arr1, arr2) {
  const set = new Set();

  // Iterate through both arrays and add unique objects to the set
  arr1.concat(arr2).forEach(obj => {
    const key = JSON.stringify([obj.stepId, obj.fieldId]);
    if (!set.has(key)) {
      set.add(key, obj);
    }
  });

  // Convert the set to an array and map the objects to ensure message property is present
  return Array.from(set.values()).map(obj => {
    const obj1 = { ...obj };
    const obj2 = arr2.find(o => o.stepId === obj1.stepId && o.fieldId === obj1.fieldId);
    if (obj2 && !obj1.message) {
      obj1.message = obj2.message;
    }
    return obj1;
  });
}

