using System;
using System.Net;
using System.Text.RegularExpressions;

namespace SteamBanCheck
{
    class Program
    {
        static void Main(string[] args)
        {
            if (args.Length != 1)
            {
                Console.WriteLine("Usage: SteamBanCheck <Steam64ID>");
                return;
            }

            string steam64id = args[0];
            string url = $"https://steamcommunity.com/profiles/{steam64id}";

            using (WebClient webClient = new WebClient())
            {
                string html = webClient.DownloadString(url);

                Match match = Regex.Match(html, "<td class=\"vacBanned\">VAC Banned: <span class=\"vacBannedDate\">(.*?)</span></td>");
                if (match.Success)
                {
                    Console.WriteLine("VAC Bans: 1");
                    Console.WriteLine("Last VAC Ban Date: " + match.Groups[1].Value);
                }
                else
                {
                    Console.WriteLine("VAC Bans: 0");
                }
            }
        }
    }
}
